$(document).ready(function(){$("#pron-to-char").on("submit",function(b){b.preventDefault();var a=$("#search-pron").val();jyutPing.searchForChar(a,function(c){if(!c.getDataTable().Nf.length){alert("not found!");return false}$("#pron-result").empty();$.each(c.getDataTable().Nf,function(d,e){console.log(e);$("#pron-result").append($("<div/>").append($("<div/>").html("Char:"+e.c[0].v)).append($("<div/>").html("pron:"+e.c[3].v)).append($("<div/>").html("source:"+e.c[4].v)))})})});$("#char-to-pron").on("submit",function(b){b.preventDefault();var a=$("#search-char").val();jyutPing.searchForPron(a,function(c){if(!c.getDataTable().Nf.length){alert("not found!");return false}$("#char-result").empty();$.each(c.getDataTable().Nf,function(d,e){console.log(e);$("#char-result").append($("<div/>").append($("<div/>").html("Char:"+e.c[0].v)).append($("<div/>").html("pron:"+e.c[3].v)).append($("<div/>").html("source:"+e.c[4].v)))})})})});